import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  headerTitulo: {
    width: "100%",
    height: "auto",
    paddingTop: 20,
    alignItems: "center",
  },
  titulotext: {
    color: "#FF0043",
    fontSize: 32,
    fontWeight: "bold",
  },
});

export default styles;
